INSERT INTO `b_thing` VALUES (99, '测试蛋糕111', 'd0c12f84-7cff-4f59-a9fd-6a33903ababe.jpeg', '蛋糕是一种美味的甜点，制作简单而丰富多样。通常由面粉、砂糖、蛋和黄油等原料混合制成面糊，然后在烤箱中烤制而成。蛋糕可以根据口味和配料的不同，分为各种种类，如海绵蛋糕、奶油蛋糕、巧克力蛋糕等。\r\n\r\n蛋糕香甜可口，口感丰富，是适合各种场合的甜点选择。在生日、节日或庆典上，蛋糕往往扮演着重要的角色，象征着甜蜜和幸福。蛋糕的装饰也是多种多样的，可以根据不同的主题和场合进行定制，从简单的水果装饰到精美的糖霜裱花，令人眼前一亮。\r\n\r\n除了传统的蛋糕种类外，现代还出现了各种创新款式的蛋糕，如芝士蛋糕、红丝绒蛋糕、抹茶蛋糕等，满足不同人群的口味需求。无论是甜食爱好者还是喜欢尝试新口味的人，都能在各种蛋糕中找到满足。让我们一起品尝美味的蛋糕，享受甜蜜的时刻！', '66', '0', '300g', '10-16人食', '9寸', '面包片+奶油+黄油', 0, '1716540269213', 3, 2, 0, 0, 0, 2, NULL);
